import React from "react";
import { Navbar, Button, Link } from "@nextui-org/react";
import { Layout } from "./Navbar/Layout.js";
import { AcmeLogo } from "./Navbar/AcmeLogo.js";
import { useTheme, Text } from '@nextui-org/react';


export default function App() {

  const [variant] = React.useState("sticky");

  return (
    <Layout>
      <Navbar variant={variant}>
        <Navbar.Brand>
          <Text b color="inherit" hideIn="xs">
            osiris.cc
          </Text>
        </Navbar.Brand>
        <Navbar.Content hideIn="xs">
          <Navbar.Link href="#">Home</Navbar.Link>
          <Navbar.Link isActive href="#">Features</Navbar.Link>
          <Navbar.Link href="#">Purchase</Navbar.Link>
        </Navbar.Content>
        <Navbar.Content>
          <Navbar.Item>
          <svg height="24" viewBox="0 0 24 24" color="fff" width="24"> <path d="M14.82 4.26a10.14 10.14 0 0 0-.53 1.1 14.66 14.66 0 0 0-4.58 0 10.14 10.14 0 0 0-.53-1.1 16 16 0 0 0-4.13 1.3 17.33 17.33 0 0 0-3 11.59 16.6 16.6 0 0 0 5.07 2.59A12.89 12.89 0 0 0 8.23 18a9.65 9.65 0 0 1-1.71-.83 3.39 3.39 0 0 0 .42-.33 11.66 11.66 0 0 0 10.12 0q.21.18.42.33a10.84 10.84 0 0 1-1.71.84 12.41 12.41 0 0 0 1.08 1.78 16.44 16.44 0 0 0 5.06-2.59 17.22 17.22 0 0 0-3-11.59 16.09 16.09 0 0 0-4.09-1.35zM8.68 14.81a1.94 1.94 0 0 1-1.8-2 1.93 1.93 0 0 1 1.8-2 1.93 1.93 0 0 1 1.8 2 1.93 1.93 0 0 1-1.8 2zm6.64 0a1.94 1.94 0 0 1-1.8-2 1.93 1.93 0 0 1 1.8-2 1.92 1.92 0 0 1 1.8 2 1.92 1.92 0 0 1-1.8 2z"> </path> </svg>
          </Navbar.Item>
        </Navbar.Content>
      </Navbar>

    <>
      <Text size="$6xl"  style = {{marginLeft: "175px", marginTop: "250px", fontWeight: "bold",  }} >The Greatest Streamable</Text>
      <Text style = {{marginLeft: "175px", marginTop: "60px"}} >Prioritizing your security and legitness, we're indisputably the greatest streamable.</Text>
    </>
    </Layout>
  );
}
